import { configureStore } from '@reduxjs/toolkit';

const initialState = {
    history: []
}
export const historySlice = configureStore({
    name: 'history',
    initialState,
    reducers: {
        ADD_HISTORY: (state) => {
            state.history.push('ssss')
        }
    }
})


export default historySlice.reducer;
